import Card from './Card';
import card1 from './card1.webp';
import card2 from './card2.webp';
import card3 from './card3.webp';

function Allcards(){
    return(
        <div className='mt-5 text-center'>
            <Card img={card1}/>
            <Card img={card2}/>
            <Card img={card3}/>
            <Card img={card1}/>
        </div>
    )
}

export default Allcards;
